import React from "react";
import "./Header.css";
const Header = () => {
  return (
    <nav>
      <img src={require("./logo.jpeg")} alt="logo" />
      <a href="Home">Home</a>
      <a href="Prices">Prices</a>
    </nav>
  );
};

export default Header;
